          <Box direction="row" align="start" gap="small">
            <Anchor href="www.google.com" color="black" label="Terms" />
            <Anchor href="www.google.com" color="black" label="Privacy" />
            <Anchor href="www.google.com" color="black" label="Do Not Sell My Personal Information" />
          </Box>
        </Footer>
      </Grommet>
    );
  }

export default Foooter;
